  CONSTRAINT `fk_rails_4d0c0195f0` FOREIGN KEY (`item_id`) REFERENCES `items` (`id`),
  CONSTRAINT `fk_rails_5cc2043d96` FOREIGN KEY (`returned_to_user_id`) REFERENCES `users` (`id`),
